window.bookSummaryJSON = "<p>Fourteen years ago I was wrongfully sentenced to life in Lakeview Asylum for the criminally insane. I'm not insane, but I am a criminal. I have many regrets in life, but the murder that landed me here isn't one of them.</p><p>After two long years of planning and one horrific storm, I'm finally free. I never wanted to take another life after I escaped Lakeview, but I'd kill a thousand times over for <i>her.</i></p><p>Alex never expected to see me again, let alone watch history repeat itself. The world ripped us apart once, but I refuse to lose her again. Our story is complicated and tainted with blood, one things for sure though; Alex Sattorie belongs to <i>me</i>.</p>"; 
